$(()=>{$.ajax({url:"http://127.0.0.1:3000/api/getbrandtitle",dataType:"json",success:t=>{let a=t.result,e="";a.forEach(t=>{e+=`\n                <li><a href="./brand.html?brandtitleid=${t.brandTitleId}&amp;category=${t.categoryId} class="" data-title-id="0"\n                        style="background-image: url(&quot;http://www.zuyushop.com/wap/images/arrow1.gif&quot;);">\n                        ${t.brandTitle}\n                    </a></li>\n                `}),$(".category-title").html(e)}})});